"""
1655. Distribute Repeating Integers
Hard

You are given an array of n integers, nums, where there are at most 50 unique values in the array. You are also given an array of m customer order quantities, quantity, where quantity[i] is the amount of integers the ith customer ordered. Determine if it is possible to distribute nums such that:

The ith customer gets exactly quantity[i] integers,
The integers the ith customer gets are all equal, and
Every customer is satisfied.
Return true if it is possible to distribute nums according to the above conditions.



Example 1:

Input: nums = [1,2,3,4], quantity = [2]
Output: false
Explanation: The 0th customer cannot be given two different integers.
Example 2:

Input: nums = [1,2,3,3], quantity = [2]
Output: true
Explanation: The 0th customer is given [3,3]. The integers [1,2] are not used.
Example 3:

Input: nums = [1,1,2,2], quantity = [2,2]
Output: true
Explanation: The 0th customer is given [1,1], and the 1st customer is given [2,2].
Example 4:

Input: nums = [1,1,2,3], quantity = [2,2]
Output: false
Explanation: Although the 0th customer could be given [1,1], the 1st customer cannot be satisfied.
Example 5:

Input: nums = [1,1,1,1,1], quantity = [2,3]
Output: true
Explanation: The 0th customer is given [1,1], and the 1st customer is given [1,1,1].


Constraints:

n == nums.length
1 <= n <= 105
1 <= nums[i] <= 1000
m == quantity.length
1 <= m <= 10
1 <= quantity[i] <= 105
There are at most 50 unique values in nums.

"""
import collections
from functools import lru_cache

"""
dp Knapsack problem bitmask

nums -> counts[i] integers are objects that we can use (size n)
quantity[i] : customers we need to satisfy using objects (size m)

state bitmask represents a state where certain customers are satisified
dp[i][0 ... 11111] : after using the first i-th objects, all customers in this state are satisified

idea

for i from 1 to n=50:
    for state from 0 to 0b1111111111: # subset of m customers
        dp[i][state] =?
            if dp[i-1][state] is true, then dp[i][state] is true
            otherwise
            for subset in state:
                if dp[i-1][state-subset] is true and object counts[i] can satisfy customers in subset, then
                  dp[i][state] is true

"""
from typing import List
import numpy

class Solution:
    def canDistribute(self, nums: List[int], quantity: List[int]) -> bool:

        m = len(quantity)
        M = (1 << m)

        # get counts of each integer available, these are objects and their counts we can use to satisfy customer
        counts_dct = {}  # length <= 1000
        for num in nums:
            if num in counts_dct:
                counts_dct[num] += 1
            else:
                counts_dct[num] = 1

        counts = list(counts_dct.values())

        n = len(counts)

        # add dummy boundary value to simplify initial value handling
        counts = [0] + counts

        # dp array to store result for whether first i objects can satisfy all customers in state
        dp = [[False for _ in range(M)] for _ in range(n + 1)]

        # initial boundary condition
        for i in range(0, n + 1):
            dp[i][0] = True  # no need to satisfy anybody, always true

        @lru_cache(None)
        def can_satisfy(count, subset):
            nonlocal quantity
            total = 0
            for j in range(m):
                if ((subset>>j) & 1) == 1:
                    total += quantity[j]

            return bool(count >= total)

        for i in range(1, n + 1):
            for state in range(M):
                if dp[i - 1][state] is True:
                    dp[i][state] = True
                    continue
                subset = state
                # loop through all non-empty subsets of state, check if counts[i] can satisfy each
                while subset > 0:
                    if dp[i - 1][state ^ subset] and can_satisfy(counts[i], subset):
                        dp[i][state] = True
                        break
                    subset = (subset - 1) & state

        # print(numpy.matrix(dp))

        return dp[n][M-1]


"""
dp top down / recursive with memoization

"""


class Solution1:
    def canDistribute(self, nums: List[int], quantity: List[int]) -> bool:
        # get counts of each integer available, these are objects and their counts we can use to satisfy customer
        num_count_dct = collections.Counter(nums)
        nums = sorted(num_count_dct.values())
        n = len(nums)
        m = len(quantity)
        M = (1 << m)

        # pre-calculate total counts required by each subset of customers (orders)
        table = collections.defaultdict(int)
        for state in range(1, M):
            for i in range(m):
                if (1<<i) & state:
                    table[state] += quantity[i]
            # print('state=%s table[state]=%s bin(table[state])=%s' % (bin(state)[2:], table[state], bin(table[state])[2:]))

        # print(table)

        @lru_cache(None)
        def helper(i, state):
            nonlocal nums, quantity
            if state == 0:
                return True
            if i == -1:
                return False
            subset = state
            while subset > 0:
                if helper(i - 1, state ^ subset) and table[subset] <= nums[i]:
                    return True
                subset = (subset - 1) & state  # loop through all subsets of state
            return helper(i-1, state)

        return helper(n-1, M - 1)

